alter table t_lc_report_day_process add user_cover_num int(5) DEFAULT NULL  COMMENT '覆盖账户数';
alter table t_lc_report_day_process add call_num int(5) DEFAULT NULL  COMMENT '拨打次数';
alter table t_lc_report_day_process add connected_call_num int(5) DEFAULT NULL  COMMENT '接通次数';

alter table t_lc_call_record add type int(2) default null comment '类型，1：打电话下电话码 2：未打电话直接下电话码3：导入催记电话码';


DROP TABLE IF EXISTS `t_lc_column_query`;
CREATE TABLE `t_lc_column_query` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `org_id` int(11) DEFAULT NULL COMMENT '委托方编码',
  `org_name` varchar(50) DEFAULT NULL COMMENT '委托方名称',
  `table_name` varchar(50) DEFAULT NULL COMMENT '表名',
  `column_name` varchar(50) DEFAULT NULL COMMENT '字段名称',
  `column_name_cn` varchar(50) DEFAULT NULL COMMENT '字段中文名',
  `column_type` varchar(255) DEFAULT NULL COMMENT '字段类型',
  `bean_name` varchar(255) DEFAULT NULL COMMENT '实体类字段',
  `column_value` varchar(4000) DEFAULT NULL COMMENT '字段值，当选择下拉框时，让用户填入值',
  `create_by` int(11) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_by` int(11) DEFAULT NULL,
  `modify_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;






